import { useEffect, useState } from 'react';
import axios from 'axios'

import './App.css';

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    const getTrades = async() => {
      const res = await axios.get('trades');
      console.log(res.data);
    }

    getTrades()
  })

  return <div className='App'>Hello</div>;
}

export default App;
